import React, { useState } from "react";
import { ComponentStory, ComponentMeta } from "@storybook/react";
import AvatarPicker from "../AvatarPicker";

// More on default export: https://storybook.js.org/docs/react/writing-stories/introduction#default-export
export default {
  title: "Inputs/AvatarPicker/Generic",
  component: AvatarPicker,
  // More on argTypes: https://storybook.js.org/docs/react/api/argtypes
  argTypes: {
    //
  },
} as ComponentMeta<typeof AvatarPicker>;

// More on component templates: https://storybook.js.org/docs/react/writing-stories/introduction#using-args
const Template: ComponentStory<typeof AvatarPicker> = args => {
  const [value, setValue] = useState(args.multiple ? [] : null);

  const onChange = e => {
    const { value } = e.target;
    setValue(value);
  };

  return (
    <AvatarPicker
      label="Change"
      form={false}
      value={value}
      onChange={onChange}
      {...args}
    />
  );
};

export const Single = Template.bind({});
Single.args = {
  //
};

export const Multiple = Template.bind({});
Multiple.args = {
  multiple: true,
};

export const WithUrl = Template.bind({});
WithUrl.args = {
  value:
    "https://images.unsplash.com/photo-1457449940276-e8deed18bfff?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=100&q=80",
};

export const WithBase64 = Template.bind({});
WithBase64.args = {
  value: `data:image/jpeg;base64,`,
};
